import './i18n';
import VRLandingPage from './components/VRLandingPage';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';


function App() {
  return     <Router>
              <Routes>
                <Route path="/" element={<VRLandingPage />} />
                <Route path="/about" element={<VRLandingPage />} />
              </Routes>
            </Router>;
}

export default App;
